import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => (
  <div className="container text-center my-5">
    <h1>Walky Loving Dogs</h1>
    <p>Aplicação de Creche para Cachorros</p>
    <Link to="/pets" className="btn btn-primary mt-3">Ver Pets</Link>
  </div>
);

export default Home;
